        Information Statement from the NTWC","url":"http://ntwc.arh.noaa.gov/events/PAAQ/2014/08/24/nat3ek/1/SEUS71/SEUS71.txt","version":"01"},"preferredWeight":6,"contents":[]}],"impact-text":[{"indexid":"13369547","indexTime":1610466985984,"id":"urn:usgs-product:us:impact-text:usb000s5tp:1416621992000","type":"impact-text","code":"usb000s5tp","source":"us","updateTime":1416621992000,"status":"UPDATE","properties":{"eventParametersPublicID":"quakeml:us.anss.org/eventparameters/b000s5tp/1416621964","eventsource":"us","eventsourcecode":"b000s5tp","original-signature":"MC0CFQCvAXo02B58Pa96Q56U/VHKfjQevwIUAMfyYqqmIQsphTvTQIIvSk09bak=","original-signature-version":"v1"},"preferredWeight":8,"contents":{"":{"contentType":"text/plain","lastModified":1416621992000,"length":997,"bytes":"One
        person killed and at least 208 people injured, 150 buildings severely damaged
        and 1,000 buildings moderately damaged in Napa County. At least 49 people
        injured, 10 buildings severely damaged and 34 buildings moderately damaged
        in Solano County. Minor damage to several roads and several water main and
        gas line breaks in Napa and Solano Counties. Electricity and water services
        disrupted in Napa, Solano and Sonoma Counties. Six fires occurred in Napa
        County destroying at least 4 buildings. At least 8 km of surface faulting
        with at least 46 cm of right-lateral and 15 cm vertical displacements observed.
        The total economic loss estimated at 400 million U.S. dollars. Felt (VIII)
        at Napa; (VII) at American Canyon, Vallejo and Yountville; (VI) at Crockett,
        Deer Park, Glen Ellen, Port Costa, Rodeo and Sonoma. Felt in many parts of
        central and northern California from Arcata to Bakersfield. Felt (II) at Reno,
        Nevada. Also felt at Carson City, Glenbrook, Incline Village, Minden and Sparks.\n","sha256":"YQ9o2Ct+CGgeUXsI3icd8HM44kTuFL/R2TKr83beoAM="}}}],"losspager":[{"indexid":"12049567","indexTime":1610344275101,"id":"urn:usgs-product:us:losspager:nc72282711:1409237435643","type":"losspager","code":"nc72282711","source":"us","updateTime":1409237435643,"status":"UPDATE","properties":{"alertlevel":"red","depth":"11.25","eventsource":"nc","eventsourcecode":"72282711","eventtime":"2014-08-24T10:20:44.000Z","latitude":"38.2202","longitude":"-122.313","magnitude":"6.0","maxmmi":"8.0","original-signature":"MCwCFAPJiqWosS8zZ60GrIgWlEdX+tZTAhRVxADfXK8//G/fRyqtekey8HRYaQ==","original-signature-version":"v1"},"preferredWeight":53,"contents":{"onepager.pdf":{"contentType":"application/octet-stream","lastModified":1409237435000,"length":460916,"url":"https://earthquake.usgs.gov/product/losspager/nc72282711/us/1409237435643/onepager.pdf","sha256":"oFjiKlMrkg/QEXkOQEHTnOD8hWpT6jyVO+JRXQlCuis="},"location.png":{"contentType":"application/octet-stream","lastModified":1409237435000,"length":15525,"url":"https://earthquake.usgs.gov/product/losspager/nc72282711/us/1409237435643/location.png","sha256":"vdkRzsskkHFJtuoNoOqnqhQuzQYd0RDrAUDwWoYknX4="},"empprob.png":{"contentType":"application/octet-stream","lastModified":1409237435000,"length":29572,"url":"https://earthquake.usgs.gov/product/losspager/nc72282711/us/1409237435643/empprob.png","sha256":"NaR6rpXzu9K1PKy7ryEAMrfxAblz4zPsWD3T0WuOVtY="},"expolegend.pdf":{"contentType":"application/octet-stream","lastModified":1409237435000,"length":124660,"url":"https://earthquake.usgs.gov/product/losspager/nc72282711/us/1409237435643/expolegend.pdf","sha256":"KfHc6/KyEyEH7j+GrBKx4+984Knaysb1xw1inBduRaE="},"semifat.png":{"contentType":"application/octet-stream","lastModified":1409237435000,"length":101440,"url":"https://earthquake.usgs.gov/product/losspager/nc72282711/us/1409237435643/semifat.png","sha256":"wz11C7WTY7OD7uTPztE06kbcLaUbmLcxYB19g