        web service 1.1\"/>\n  <grammars/>\n  <resources base=\"https://service.ncedc.org/fdsnws/dataselect/1/\">\n
        \   <resource path=\"/\">\n      <method name=\"GET\" id=\"root\">\n        <response>\n
        \         <representation mediaType=\"text/html\"/>\n        </response>\n
        \     </method>\n      <resource path=\"/query\">\n        <method name=\"GET\"
        id=\"query\">\n          <request>\n            <param name=\"starttime\"
        style=\"query\" required=\"true\" type=\"xs:date\"/>\n            <doc xml:lang=\"english\"
        title=\"limit to channels that are active on or after the specified start
        time\">\n              Examples: starttime=2012-11-29 or 2012-11-29T00:00:00
        or 2012-11-29T00:00:00.000 </doc>\n            <param name=\"endtime\" style=\"query\"
        required=\"true\" type=\"xs:date\"/>\n            <doc xml:lang=\"english\"
        title=\"limit to channels that are active on or before the specified end time\">\n
        \             Examples: endtime=2012-11-29 or 2012-11-29T00:00:00 or 2012-11-29T00:00:00.000
        </doc>\n            <param name=\"network\" style=\"query\" type=\"xs:string\"/>\n
        \           <doc xml:lang=\"english\" title=\"Select one or more network codes.
        Lists and wildcards are accepted\"> Examples:\n              network=BK or
        network=BK,NC or network=B? </doc>\n            <param name=\"station\" style=\"query\"
        type=\"xs:string\"/>\n            <doc xml:lang=\"english\" title=\"Select
        one or more SEED station codes. Lists and wildcards are accepted\">\n              Examples:
        station=BKS or station=BKS,CMB or station=C* or station=?MN? </doc>\n            <param
        name=\"location\" style=\"query\" type=\"xs:string\"/>\n            <doc xml:lang=\"english\"
        title=\"Select one or more SEED location codes. Use -- for spaces. Lists and
        wildcards are accepted\">\n              Examples: location=-- or location=?0
        or location=--,10 </doc>\n            <param name=\"channel\" style=\"query\"
        type=\"xs:string\"/>\n            <doc xml:lang=\"english\" title=\"Select
        one or more SEED channel codes. Lists and wildcards are accepted\">\n              Examples:
        channel=BHZ or channel=BH1,BH2 or channel=*Z or channel=BH? </doc>\n          </request>\n
        \         <response>\n            <representation mediaType=\"text/plain\"/>\n
        \           <representation mediaType=\"application/vnd.fdsn.mseed\"/>\n          </response>\n
        \       </method>\n        <method name=\"POST\" id=\"postQuery\">\n          <request>\n
        \           <representation mediaType=\"*/*\"/>\n          </request>\n          <response>\n
        \           <representation mediaType=\"text/plain\"/>\n            <representation
        mediaType=\"application/vnd.fdsn.mseed\"/>\n          </response>\n        </method>\n
        \     </resource>\n      <resource path=\"/version\">\n        <method name=\"GET\"
        id=\"version\">\n          <response>\n            <representation mediaType=\"text/plain\"/>\n
        \         </response>\n        </method>\n      </resource>\n      <resource
        path=\"/application.wadl\">\n        <method name=\"GET\" id=\"application.wadl\">\n
